import React, { Component } from 'react';
import withRouter from "../../withRouter";
import axios from 'axios';
import '../../App.css';

class RegistrationForm extends Component {
    constructor(props) {
        super(props);
        this.state = {
            firstName: '',
            lastName: '',
            email: '',
            password: '',
            userRole: 'Tenant',
            isValidEmail: true // Added state for email validation
        };

        this.onSubmit = this.onSubmit.bind(this);
    }

    handleFirstNameChange = (e) => {
        this.setState({ firstName: e.target.value });
    };

    handleLastNameChange = (e) => {
        this.setState({ lastName: e.target.value });
    };

    handleEmailChange = (e) => {
        const email = e.target.value;
        this.setState({ email, isValidEmail: this.validateEmail(email) });
    };

    validateEmail = (email) => {
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return emailRegex.test(email);
    };

    handlePasswordChange = (e) => {
        this.setState({ password: e.target.value });
    };

    handleUserRoleChange = (e) => {
        this.setState({ userRole: e.target.value });
    };

    onSubmit() {
        const { firstName, lastName, email, password, userRole, isValidEmail } = this.state;

        // Perform email validation
        if (!isValidEmail) {
            console.error('Invalid email address');
            return;
        }

        // Proceed with form submission
        const formData = { firstName, lastName, email, password, userRole };

        axios.post('http://localhost:3001/submit-form', formData)
            .then(response => {
                console.log(response.data);
                this.props.navigate('/');
            })
            .catch(error => {
                console.error('Error submitting form:', error);
            });
    }

    render() {
        const { isValidEmail } = this.state;

        return (
            <div className="login-form">
                <form>
                    <h1>REGISTRATION</h1>
                    <div className="content">
                        <div className="content">
                            <div className="input-field">
                                <input
                                    type="text"
                                    placeholder="First name"
                                    autoComplete="nope"
                                    value={this.state.firstName}
                                    onChange={this.handleFirstNameChange}
                                />
                            </div>
                            <div className="input-field">
                                <input
                                    type="text"
                                    placeholder="Last name"
                                    autoComplete="nope"
                                    value={this.state.lastName}
                                    onChange={this.handleLastNameChange}
                                />
                            </div>
                            <div className="input-field">
                                <input
                                    type="email"
                                    placeholder="Email"
                                    autoComplete="nope"
                                    value={this.state.email}
                                    onChange={this.handleEmailChange}
                                    className={!isValidEmail ? 'invalid' : ''}
                                />
                            </div>
                            <div className="input-field">
                                <input
                                    type="password"
                                    placeholder="Password"
                                    autoComplete="nope"
                                    value={this.state.password}
                                    onChange={this.handlePasswordChange}
                                />
                            </div>
                            <div className="input-field">
                                <label htmlFor="user">USER:</label>
                                <select id="user" name="USER" value={this.state.userRole} onChange={this.handleUserRoleChange}>
                                    <option value="tenant">Tenant</option>
                                    <option value="customer">Customer</option>
                                </select>
                            </div>
                        </div>
                    </div>
                    <div className="action">
                        <button onClick={this.onSubmit} type="button" className="submit-button" disabled={!isValidEmail}>
                            Submit
                        </button>
                    </div>
                </form>
            </div>
        );
    }
}

export default withRouter(RegistrationForm);
